        protected static void FillPrivateElementXml(
            OblivionMod item,
            XElement node,
            string name,
            ErrorMaskBuilder errorMask,
            TranslationCrystal translationMask)
        {
            switch (name)
            {
                case "ModHeader":
                    try
                    {
                        errorMask?.PushIndex((int)OblivionMod_FieldIndex.ModHeader);
                        item.ModHeader.CopyFieldsFrom(
                            rhs: ModHeader.CreateFromXml(
                                node: node,
                                errorMask: errorMask,
                                translationMask: translationMask),
                            def: null,
                            copyMask: null,
                            errorMask: errorMask);
                    }
                    catch (Exception ex)
                    when (errorMask != null)
                    {
                        errorMask.ReportException(ex);
                    }
                    finally
                    {
                        errorMask?.PopIndex();
                    }
                    break;
                case "Cells":
                    try
                    {
                        errorMask?.PushIndex((int)OblivionMod_FieldIndex.Cells);
                        item.Cells.CopyFieldsFrom<CellBlock_CopyMask>(
                            rhs: ListGroup<CellBlock>.CreateFromXml(
                                node: node,
                                errorMask: errorMask,
                                translationMask: translationMask),
                            def: null,
                            copyMask: null,
                            errorMask: errorMask);
                    }
                    catch (Exception ex)
                    when (errorMask != null)
                    {
                        errorMask.ReportException(ex);
                    }
                    finally
                    {
                        errorMask?.PopIndex();
                    }
                    break;
                default:
                    break;
            }
        }

