            foreach (var item in AnimatedObjects.Links)
            {
                yield return item;
            }
            foreach (var item in Waters.Links)
            {
                yield return item;
            }
            foreach (var item in EffectShaders.Links)
            {
                yield return item;
            }
            yield break;
        }

