        public static OblivionMod Copy(
            OblivionMod item,
            OblivionMod_CopyMask copyMask = null,
            OblivionMod def = null)
        {
            OblivionMod ret;
            if (item.GetType().Equals(typeof(OblivionMod)))
            {
                ret = new OblivionMod();
            }
            else
            {
                ret = (OblivionMod)System.Activator.CreateInstance(item.GetType());
            }
            ret.CopyFieldsFrom(
                item,
                copyMask: copyMask,
                def: def);
            return ret;
        }

