            string path,
            ModKey modKey,
            out OblivionMod_ErrorMask errorMask,
            bool doMasks = true,
            GroupMask importMask = null)
        {
            using (var memStream = new MemoryTributary())
            {
                using (var writer = new MutagenWriter(memStream, dispose: false, meta: MetaDataConstants.Get(item.GameMode)))
